import React from "react";
import "./index.css"
function Cards(props){
    return(
        <div className="caards">
           <div className="cards">
           <div className="card">
                <h1>{props.snam}</h1>
                <h2>{props.titl}</h2>
            </div>
           </div>
           
        </div>
    )
}

export default Cards
